import cls from './App.css';
function App() {
  return (
    <div className={cls.cardcontainer}>
        <img src="./logo-pic.png" alt="odjel logo" className={cls.logo_pic} />
        <span className={cls.titleOdjel}>TITLE</span>
        <span className={cls.descOdjel}>SHORT DESC</span>

        <div className={cls.btnlinecontainer}>
          <div className={cls.btnline}></div>
          <span className={cls.btnlinetxt}>STANI U RED</span>
        </div>
      </div>
  );
}

export default App;
